import React from "react";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import { useHistory } from "react-router-dom";
import "../path-to-your-css-file/subjectListItem.css";

const SubjectsListItem = ({ name, code }) => {
  const history = useHistory();

  const handleSubjectClick = () => {
    history.push(`/subject/${code}`);
  };

  return (
    <Button
      disabled={false}
      onClick={handleSubjectClick}
      className="subject-list-item-button">
      <Typography
        className="subject-list-item-text"
        variant="subtitle1"
        align="left">
        {name}
      </Typography>
    </Button>
  );
};

export default SubjectsListItem;
